struct alGraph {
    Vec nodeCoords[4];
    Edge edges[9];
    int numEdges = 0;

	alGraph() {
		for (int i = 0; i < 4; i++)
			nodeCoords[i] = Vec(nodeData[0][i*2], nodeData[0][i*2+1]);
	}

	alGraph(int id) {
		for (int i = 0; i < 4; i++)
			nodeCoords[i] = Vec(nodeData[id][i*2+1], nodeData[id][i*2+2]);
        if (id != 0) {
            int curveDataIndex = 1;
            for (int i = 0; i < 9; i++) {
                if (moveCurveData[id][i].x != -2) {
                    numEdges++;
                    edges[i].moveCoords = moveCurveData[id][i];
                    for (int j = 0; j < 15; j++) {
                        if (xCurveData[id][curveDataIndex] == -1) {
                            curveDataIndex++;
                            break;
                        }
                        else if (xCurveData[id][curveDataIndex] == -2) 
                            break;
                        else {
                            edges[i].curveLength++; 
                            for (int k = 0; k < 3; k++)
                                edges[i].curve[j][k] = Vec(xCurveData[id][curveDataIndex + k], yCurveData[id][curveDataIndex + k]);
                            curveDataIndex += 3;
                        }
                    }
                }
            }
        }
	}

    bool operator> (const alGraph &g) {
        return numEdges > g.numEdges; 
    }
    bool operator< (const alGraph &g) {
        return numEdges < g.numEdges; 
    }
    bool operator>= (const alGraph &g) {
        return numEdges >= g.numEdges; 
    }
    bool operator<= (const alGraph &g) {
        return numEdges <= g.numEdges; 
    }
    bool operator== (const alGraph &g) {
        return numEdges == g.numEdges; 
    }
};